import React from "react";

class Header extends React.Component {
    render() {
        const { headerNav } = this.props;
        return (
            <header>
                <div>
                    <img alt='logo' />
                    <ul>
                        {headerNav.map((item, i) => (
                        <Link to={`/${item.path}`}><li></li></Link>
                    ))}
                    </ul>
                </div>
            </header>
        )
    }
}

export default Header;
